const humanSubjectIcon = createIcon(humanSubjectTemplate);

const machineSubjectIcon = createIcon(machineSubjectTemplate);

const humanTypeJointOptions: joint.shapes.standard.ImageAttributes = {
	size: {
		width: 85,
		height: 140,
	},
	attrs: {
		image: {
			width: 85,
			height: 140,
			cursor: "pointer",
			xlinkHref: humanSubjectIcon,
		},
		label: {
			textWrap: {
				width: 85,
				height: 140,
				text: "Subject",
			},
			fontFamily: FONT_FAMILY,
			pointerEvents: "none",
		},
	},
};

const machineTypeJointOptions: joint.shapes.standard.ImageAttributes =
	joint.util.merge(joint.util.cloneDeep(humanTypeJointOptions), {
		size: {
			width: 105,
			height: 140,
		},
		attrs: {
			image: {
				width: 105,
				height: 140,
				xlinkHref: machineSubjectIcon,
			},
			label: {
				textWrap: {
					width: 105,
				},
			},
		},
	});

const humanToolsOptions: SbpmElementToolsOptions = [
	{
		type: "remove",
		options: {
			x: 95,
		},
	},
	{
		type: "connect",
		options: {
			x: 119,
		},
	},
	{
		type: "open",
		options: {
			x: 143,
			markup: [
				{
					tagName: "rect",
				},
				{
					tagName: "image",
					attributes: {
						"xlink:href": openInNew,
					},
				},
				{
					tagName: "title",
					textContent: "Open",
				},
			],
		},
	},
];

const machineToolsOptions: SbpmElementToolsOptions = joint.util.merge(
	joint.util.cloneDeep(humanToolsOptions),
	[
		{
			type: "remove",
			options: {
				x: 115,
			},
		},
		{
			type: "connect",
			options: {
				x: 139,
			},
		},
		{
			type: "open",
			options: {
				x: 163,
			},
		},
	],
) as SbpmElementToolsOptions;

export class SbpmSubject extends SbpmElement {
	type: SbpmSubjectType = "Subject";

	constructor(options: SbpmSubjectOptions, modelerOptions: SbpmModelerOptions) {
		const { label, representation = "human", ...restOptions } = options;

		const jointOptions =
			representation === "human"
				? humanTypeJointOptions
				: machineTypeJointOptions;
		const toolsOptions =
			representation === "human" ? humanToolsOptions : machineToolsOptions;

		const attributes = joint.util.merge(joint.util.cloneDeep(jointOptions), {
			attrs: {
				label: {
					textWrap: {
						text: label,
					},
				},
			},
			toolsOptions: addActionsToElementToolsOptions(
				toolsOptions,
				modelerOptions,
			),
			type: createJointType("sbpm.pnd", "Subject"),
			...restOptions,
		}) as SbpmElementAttributes;

		super(attributes);

		this.modelerOptions = modelerOptions;
	}

	public update(options: GetUpdateOptions<SbpmSubjectOptions>) {
		const { representation, ...restOptions } = options;

		if (representation) {
			console.log("test", this.graph.attributes);

			const jointOptions =
				representation === "human"
					? humanTypeJointOptions
					: machineTypeJointOptions;
			const toolsOptions =
				representation === "human" ? humanToolsOptions : machineToolsOptions;

			// eslint-disable-next-line @typescript-eslint/ban-ts-comment
			// @ts-ignore
			this.size(jointOptions.size);
			// eslint-disable-next-line @typescript-eslint/ban-ts-comment
			// @ts-ignore
			this.attr("image/xlinkHref", jointOptions.attrs?.image.xlinkHref);
			this.attr("image/width", jointOptions.attrs?.image?.width);
			this.attr("image/height", jointOptions.attrs?.image?.height);
			this.attr("image/height", jointOptions.attrs?.image?.height);
			this.prop(
				"toolsOptions",
				addActionsToElementToolsOptions(toolsOptions, this.modelerOptions),
			);
		}

		super.update(restOptions);
	}

	public getUpdatableOptions(): GetUpdateOptions<SbpmSubjectOptions> {
		const options =
			super.getUpdatableOptions() as GetUpdateOptions<SbpmSubjectOptions>;

		if (
			this.attr("image/xlinkHref") ===
			humanTypeJointOptions.attrs?.image?.xlinkHref
		) {
			options.representation = "human";
		}

		if (
			this.attr("image/xlinkHref") ===
			machineTypeJointOptions.attrs?.image?.xlinkHref
		) {
			options.representation = "machine";
		}

		return options;
	}
}
